import React from 'react';
import {useSelector} from 'react-redux';


const Header = () => {

    const usuario = useSelector( state => state.userdata.datosusuario);
    

    

    return ( 

        <div className="container-fluid bg-primary p-5 mb-5">
            <div className="row">
                <div className="col-md-4">
                    1
                </div>
                <div className="col-md-4">
                    2
                </div>
                <div className="col-md-4">
                        <span className="font-weight-bold text-white">Bienvenido : {usuario ? usuario.nombre : null}</span>
                </div>
            </div>
        </div>
     );
}
 
export default Header;
